import React, { Component } from "react";
import PostBox from "../../Components/PostBox";
import './PostingScreenStyle.css';

export default class PostingScreen extends Component{
    state={
        loading: true,
        posts: null,
    }

     constructor(props){
        super(props);

        fetch('localhost:5001/posts')
            .then(res => res.json())
            .then(data=> {
                console.log(data);
            })

    }

    render(){
        return(
            <div id="pageBox">
                {
                    this.state.loading && !this.state.posts ? (<></>
                    ) : (
                    <PostBox title="hello" description="world"></PostBox>
                )}
            </div>
        );
    }
}
